--
-- Name: auto_distribute_weights(integer); Type: FUNCTION; Schema: public; Owner: root
--

CREATE FUNCTION public.auto_distribute_weights(p_column_id integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_quiz_count INTEGER;
    v_equal_weight DECIMAL;
    v_updated_count INTEGER;
BEGIN
    -- Đếm số quiz trong cột
    SELECT COUNT(*) INTO v_quiz_count
    FROM "CourseGradeColumnQuizzes"
    WHERE column_id = p_column_id;
    
    IF v_quiz_count = 0 THEN
        RETURN 0;
    END IF;
    
    -- Tính weight bằng nhau
    v_equal_weight := ROUND(100.0 / v_quiz_count, 2);
    
    -- Update weight cho tất cả quiz trong cột
    UPDATE "CourseGradeColumnQuizzes"
    SET weight_percentage = v_equal_weight
    WHERE column_id = p_column_id;
    
    GET DIAGNOSTICS v_updated_count = ROW_COUNT;
    
    RETURN v_updated_count;
END;
$$;


ALTER FUNCTION public.auto_distribute_weights(p_column_id integer) OWNER TO root;

