-- Name: validate_course_grade_columns_weight(integer); Type: FUNCTION; Schema: public; Owner: root
--

CREATE FUNCTION public.validate_course_grade_columns_weight(p_course_id integer) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
DECLARE
    total_weight DECIMAL;
BEGIN
    SELECT COALESCE(SUM("weight_percentage"), 0) 
    INTO total_weight
    FROM "CourseGradeColumns" 
    WHERE "course_id" = p_course_id AND "is_active" = true;
    
    RETURN ABS(total_weight - 100) < 0.01;
END;
$$;


