--
-- Name: EggTypeStats; Type: VIEW; Schema: public; Owner: root
--

CREATE VIEW public."EggTypeStats" AS
 SELECT et.egg_type_id,
    et.egg_name,
    et.rarity,
    count(ue.user_egg_id) AS total_obtained,
    count(
        CASE
            WHEN (ue.is_opened = false) THEN 1
            ELSE NULL::integer
        END) AS currently_owned,
    count(
        CASE
            WHEN (ue.is_opened = true) THEN 1
            ELSE NULL::integer
        END) AS total_opened,
    count(DISTINCT ue.user_id) AS unique_owners
   FROM (public."EggTypes" et
     LEFT JOIN public."UserEggs" ue ON ((et.egg_type_id = ue.egg_type_id)))
  GROUP BY et.egg_type_id, et.egg_name, et.rarity;


