    score_history jsonb DEFAULT '[]'::jsonb NOT NULL,
    detailed_analysis jsonb DEFAULT '{"consistency_score": 0, "improvement_trend": 0, "assessment_breakdown": {}, "contributing_subjects": {}}'::jsonb NOT NULL,
    predictions jsonb DEFAULT '{"risk_factors": [], "predicted_final_score": 0, "estimated_completion_date": null, "recommended_interventions": [], "probability_of_achievement": 0}'::jsonb NOT NULL,
    milestones jsonb DEFAULT '{"checkpoints": [], "next_milestone": null, "completion_percentage": 0}'::jsonb NOT NULL,
    evidence_count integer DEFAULT 0 NOT NULL,
    last_assessment_date timestamp with time zone,
    first_assessment_date timestamp with time zone,
    program_weight double precision DEFAULT 1.0 NOT NULL,
    notes text,
    is_active boolean DEFAULT true NOT NULL,
    last_updated timestamp with time zone DEFAULT now() NOT NULL,
    "createdAt" timestamp with time zone DEFAULT now() NOT NULL,
    "updatedAt" timestamp with time zone DEFAULT now() NOT NULL,
    CONSTRAINT "ProgramOutcomeTracking_outcome_type_check" CHECK (((outcome_type)::text = ANY ((ARRAY['PO'::character varying, 'PLO'::character varying])::text[]))),
    CONSTRAINT "ProgramOutcomeTracking_po_plo_check" CHECK ((((po_id IS NOT NULL) AND (plo_id IS NULL) AND ((outcome_type)::text = 'PO'::text)) OR ((po_id IS NULL) AND (plo_id IS NOT NULL) AND ((outcome_type)::text = 'PLO'::text)))),
    CONSTRAINT "ProgramOutcomeTracking_score_check" CHECK (((current_score >= (0)::double precision) AND (current_score <= (100)::double precision))),
    CONSTRAINT "ProgramOutcomeTracking_status_check" CHECK (((achievement_status)::text = ANY ((ARRAY['not_started'::character varying, 'in_progress'::character varying, 'achieved'::character varying, 'exceeded'::character varying, 'at_risk'::character varying])::text[]))),
    CONSTRAINT "ProgramOutcomeTracking_target_check" CHECK (((target_score >= (0)::double precision) AND (target_score <= (100)::double precision)))
);


