--
-- Name: UserCurrencyStats; Type: VIEW; Schema: public; Owner: root
--

CREATE VIEW public."UserCurrencyStats" AS
 SELECT u.user_id,
    u.name AS user_name,
    u.current_level,
    uc_sync.balance AS syncoin_balance,
    uc_sync.total_earned AS syncoin_total_earned,
    uc_sync.total_spent AS syncoin_total_spent,
    uc_kris.balance AS kristal_balance,
    uc_kris.total_earned AS kristal_total_earned,
    uc_kris.total_spent AS kristal_total_spent,
    (uc_sync.balance + (uc_kris.balance * 10)) AS total_wealth_in_syncoin
   FROM ((public."Users" u
     LEFT JOIN public."UserCurrencies" uc_sync ON (((u.user_id = uc_sync.user_id) AND (uc_sync.currency_id = ( SELECT "Currencies".currency_id
           FROM public."Currencies"
          WHERE (("Currencies".currency_code)::text = 'SYNC'::text))))))
     LEFT JOIN public."UserCurrencies" uc_kris ON (((u.user_id = uc_kris.user_id) AND (uc_kris.currency_id = ( SELECT "Currencies".currency_id
           FROM public."Currencies"
          WHERE (("Currencies".currency_code)::text = 'KRIS'::text))))));


