CREATE OR REPLACE VIEW public."AssignmentSummaryBySemester" AS
 SELECT s.semester_id,
    s.name AS semester_name,
    s.academic_year,
    count(tsa.assignment_id) AS total_assignments,
    count(DISTINCT tsa.teacher_id) AS teacher_count,
    count(DISTINCT tsa.subject_id) AS subject_count,
    count(
        CASE
            WHEN (tsa.is_active = true) THEN 1
            ELSE NULL::integer
        END) AS active_assignments
   FROM (public."Semesters" s
     LEFT JOIN public."TeacherSubjectAssignments" tsa ON ((s.semester_id = tsa.semester_id)))
  GROUP BY s.semester_id, s.name, s.academic_year
  ORDER BY s.academic_year DESC, s.semester_number;


