1	Vận dụng kiến thức cơ bản về khoa học tựnhiên, khoa học xã hội, khoa học chính trị và pháp luật để giải quyết vấn đề liên quan chuyên ngành.	1	PLO1
2	Kết hợp kiến thức chuyên môn để giải quyết các vấn đề liên quan công nghệ thông tin.	1	PLO2
3	Phân tích các vấn đề tính toán phức tạp để xác định các giải pháp bằng cách áp dụng các nguyên lý của máy tính và công nghệ thông tin.	1	PLO3
4	Triển khai các giải pháp công nghệ thông tin bằng cách đánh giá, thiết kế và cài đặt để đáp ứng yêu cầu thực tế.	1	PLO4
5	Kết hợp các giải pháp có tính hệ thống để lựa chọn, phát triển, áp dụng, tích hợp và quản trị an toàn các hệ thống công nghệ thông tin nhằm đạt được các mục tiêu của người dùng.	1	PLO5
6	Sử dụng tốt tiếng Anh trong soạn thảo, đọc tài liệu và giao tiếp, đạt bậc 3/6 theo khung năng lực ngoại ngữ của Việt Nam.	1	PLO6
7	Phối hợp tốt các kỹ năng trình bày và giao tiếp trong bối cảnh nghề nghiệp.	1	PLO7
8	Phối hợp hiệu quả các kỹ năng làm việc nhóm với tư cách là thành viên hoặc người lãnh đạo.	1	PLO8
9	Tôn trọng trách nhiệm nghề nghiệp để đưa ra các đánh giá chuyên môn dựa trên chuẩn mực đạo đức và pháp luật.	1	PLO9
10	Tôn trọng sự cần thiết của quá trình học tập suốt đời.	1	PLO10
